import classes from './SignUp.module.css';

function SignUp() {
  const [userDetails, setUserDetails] = useState({
    name: "",
    email: "",
    password: "",
    empcode: "",
    address: "",
    joiningdate: "",

  });
  const onChangeHandler = (e) => {
    let user = userDetails;
    user[e.target.name] = e.target.value;
    setUserDetails(user);
  };

  const onSubmitHandler = async (e) => {
    e.preventDefault();
    return;        
  }
    return (
      <div className={classes.SignUp}>
      <div className={classes.SignUp_Image}>
          <img src={SignIn_Img} alt="SignIn" />
      </div>
      <div className={classes.SignIn_Box}>
            <form onSubmit={onSubmitHandler}>
              <h1 className={classes.title_SU}>SIGN IN</h1>
              <br></br>
              <input
                type="text"
                placeholder="Email"
                name="email"
                value={userDetails.email}
                onChange={onChangeHandler}
              /><br></br>

              <input
                type="password"
                placeholder="Password"
                name="password"
                value={userDetails.password}
                onChange={onChangeHandler}
              /><br></br>

              <input type="submit" value="SUBMIT" />
              <br></br>
              <div className={classes.bottomLinkWrapper}>
              <Link to="/forgot-password" className={classes.BottomLinks}>
                Forgot Password ?
              </Link>
              <br></br>
              <Link to="/signup" className={classes.BottomLinks}>
                New User ?
              </Link>
            </div>
            </form>
        </div>
    </div>
    );
  }
  
  export default SignUp;
